from translator import codon_dict

protein=''
listcal=[3] #3 bc we always have 3 stop codons
for amino in protein:
    a=0
    for k,v in codon_dict.items():
        if v==amino:
            a+=1
    listcal.append(a)

result=1
for el in listcal:
    result=result*el

print(result %1000000)

